import React, { useState } from 'react';
import './prev.css';
import {Box, Alert, IconButton, Collapse, Button} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import { useHistory } from 'react-router-dom';


import {
  TableBody,
  TableCell,
  TableRow,
  TableHead,
  TableContainer,
  Table,
  Paper
} from '@mui/material';


export default function Preview() {
  let history = useHistory();

  function data() {
    history.push("/data");
  }
  const [open, setOpen] = useState(true);
 
  return (
    
    <>
      <div className='preview'>
      <Box sx={{ width: '20%', position:'absolute', left:'40%' }}>
      <Collapse in={open}>
        <Alert
          action={
            <IconButton
              aria-label="close"
              color="inherit"
              size="small"
              onClick={() => {
                setOpen(false);
              }}
            >
              <CloseIcon fontSize="inherit" />
            </IconButton>
          }
          sx={{ mb: 2 }}
        >
          Workout is added successfully
        </Alert>
      </Collapse>
      
    </Box>

        
        <div className='workoutdata'>
          <h1>Workout Preview</h1>
        </div>
      </div>
      
        <div className='table'>
        <TableContainer component={Paper}>
            <Table sx={{ minWidth: 400 }} size="small" aria-label="a dense table" align = 'top'>
            <TableHead>
              <TableRow
                style={{ backgroundColor: 'burlywood', color: 'blue', padding: '15px' }}
              >
                <TableCell>Exercise Name</TableCell>
                <TableCell>Sets</TableCell>
                <TableCell>Reps</TableCell>
                <TableCell>Unit</TableCell>
                <TableCell>Date</TableCell>
              </TableRow>
            </TableHead>
            {/* <TableBody>
                {finalData.map((data) =>(
                    <TableRow key = {data.email}>
                        <TableCell  component="th" scope="row">{data.exercisename}</TableCell>
                        <TableCell>{data.sets}</TableCell>
                        <TableCell>{data.reps}</TableCell>
                        <TableCell>{data.units}</TableCell>
                        <TableCell>{data.date}</TableCell>
                    </TableRow>
                ))}
            </TableBody> */}
          </Table>
        </TableContainer>
        </div>
        <div>
        <Button
                  variant='contained'
                  onClick={data}
                  sx={{
                    ml: 17,
                    mt: 3,
                  }}
                  noValidate
                >
                  Create New
                </Button>
        </div>
    </>
  );
}
